INSERT INTO `objetivos_nacionales` VALUES (1,'Garantizar la continuidad y consolidación de la Revolución Bolivariana.',1),(2,'Preservar y consolidar la soberanía sobre los recursos petroleros y demás recursos naturales estratégicos.',1),(3,'Garantizar el manejo soberano del ingreso nacional.',1),(4,'Lograr la soberanía alimentaria para garantizar el sagrado derecho a la alimentación de nuestro pueblo.',1),(5,'Desarrollar nuestras capacidades científico-tecnológicas vinculadas a las necesidades del pueblo.',1),(6,'Fortalecer el poder defensivo nacional para proteger la Independencia y la soberanía nacional, asegurando los recursos y riquezas de nuestro país para las futuras generaciones.',1),(7,'Adecuar el aparato económico productivo, la infraestructura y los servicios del Estado incrementando la capacidad de respuesta a las necesidades del pueblo ante posibles estados de excepción en el marco de la Defensa Integral de la Nación.',1),(8,'Propulsar la transformación del sistema económico, en función de la transición al socialismo bolivariano, trascendiendo el modelo rentista petrolero capitalista hacia el modelo económico productivo socialista, basado en el desarrollo de las fuerzas productivas.',2),(9,'Construir una sociedad igualitaria y justa.',2),(10,'Consolidar y expandir el poder popular y la democracia socialista. Alcanzar la soberanía plena, como garantía de irreversibilidad del proyecto bolivariano, es el propósito central del ejercido del poder por parte del pueblo consciente y organizado. La gestación y desarrollo de nuevas instancias de participación popular dan cuenta de como la Revolución Bolivariana avanza consolidando la hegemonía y el control de la orientación política, social, económica y cultural de la nación. El poder que habla sido secuestrado por la oligarquía va siendo restituido al pueblo, quien, de batalla en batalla y de victoria en victoria, ha aumentado su nivel de complejidad organizativa.',2),(11,'Convocar y promover una nueva orientación ética, moral y espiritual de la sociedad, basada en los valores liberadores del socialismo.',2),(12,'Lograr la irrupción definitiva del Nuevo Estado Democrático y Social, de Derecho y de Justicia.',2),(13,'Consolidar el papel de Venezuela como Potencia Energética Mundial.',3),(14,'Desarrollar el poderío económico en base al aprovechamiento óptimo de las potencialidades que ofrecen nuestros recursos para la generación de la máxima felicidad de nuestro pueblo, así como de las bases materiales para la construcción de nuestro socialismo bolivariano.',3),(15,'Ampliar y conformar el poderío militar para la defensa de la Patria. Nuestra Patria promueve la cooperación pacifica entre las naciones, impulsa la integración latinoamericana y caribeña, el principio de autodeterminación de los pueblos y la no intervención en los asuntos internos de cada país, es por ello que el poderlo militar del país es netamente defensivo y disuasivo, que no amenaza a nadie ni tiene pretensiones invasoras, todo lo contrario somos promotores de la paz y de la integración latinoamericana y caribeña para contribuir con la defensa de nuestros pueblos, ello nos obliga a garantizar cada día el fortalecimiento de nuestras propias doctrinas y tecnologías militares que nos permitan ser una referencia pacifica en la región, adecuando nuestra industria militar a nuestras propias necesidades, derivadas de la realidad geoestratógica de nuestra Patria, valiéndonos de la cooperación con países amigos.',3),(16,'Profundizar el desarrollo de la nueva geopolítica nacional.',3),(17,'Continuar desempeñando un papel protagónico en la construcción de la unión latinoamericana y caribeña.',4),(18,'Afianzar la identidad nacional y nuestro americana.',4),(19,'Continuar impulsando el desarrollo de un mundo multicéntrico y pluripolar sin dominación imperial y con respeto a la autodeterminación de los pueblos',4),(20,'Desmontar el sistema neocolonial de dominación imperial.',4),(21,'Construir e impulsar el modelo económico productivo eco-socialista, basado en una relación armónica entre el hombre y la naturaleza, que garantice el uso y aprovechamiento racional, óptimo y sostenible de los recursos naturales, respetando los procesos y ciclos de la naturaleza.',5),(22,'Proteger y defender la soberanía permanente del Estado sobre los recursos naturales para el beneficio supremo de nuestro Pueblo, que será su principal garante.',5),(23,'Defender y proteger el patrimonio histórico y cultural venezolano y nuestroamericano.',5),(24,'Contribuir a la conformación de un gran movimiento mundial para contener las causas y reparar los efectos de cambio climático que ocurren como consecuencia del modelo capitalista depredador.',5);
